import React, { useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import Slots from '../components/Slots';
import { Col, Row, Card } from 'react-bootstrap';
import { listSlots } from '../redux/actions/slotActions';
import ReactLoading from 'react-loading';
import Message from '../components/Message';
import { LinkContainer } from 'react-router-bootstrap';

const HomeScreen = () => {
  const dispatch = useDispatch();
  const slotList = useSelector((state) => state.slotList);
  const { loading, allSlots, error } = slotList;

  useEffect(() => {
    dispatch(listSlots());
    console.log('all');
    console.log(allSlots);
  }, [dispatch]);

  return (
    <>
      <h1 className="text-warning my-4">
        <i class="far fa-clock text-success"></i> {allSlots.length}
      </h1>

      <Row></Row>
    </>
  );
};

export default HomeScreen;
